    "2015-08-04T14:58:08.863751",nt"name": "laysan-teal-anas-laysanensis-microsatellite-dna-data-laysan-island-1999-2009-midway-a-2007-2010",nt"isopen":
    false,nt"url": null,nt"notes": "The geographically closed, non-migratory
    populations of endangered Laysan Teal (Anas laysanensis) were sampled in the wild.
    This species was once widespread across the Hawaiian archipelago, but became isolated
    on Laysan Island (415 ha) from the mid-1800s until 2004 when a translocation to
    Midway Atoll (596 ha) was undertaken to reduce extinction risks. We compared genetic
    diversity and quantified variation at microsatellite loci sampled from 229 individuals
    from the wild populations at Laysan Island (1999u20132009) and Midway Atoll (2007u20132010;
    n = 133 Laysan, n = 96 Midway birds). We identified polymorphic markers by screening
    nuclear microsatellites (N = 83). Low nuclear variation was detected, consistent
    with the speciesu2019 insular isolation and historical bottleneck. Six of 83 microsatellites
    were polymorphic.",nt"license_title": null,nt"extras": [{ntt"key":
